// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

contract Auction{
    struct bidder{
        uint bidderId;
        string addr;
        uint total_tokens;
    }
    struct item{
        uint itemid;
        uint[] itemTokens;
    }

    struct bid{
        uint itemid;
        string bidder_address;
        uint amount;

    }



    mapping(string => bidder) tokendetails; //map of address to bidder
    bidder[] public   bidders; //contains list of bidders
    uint bidderCount =0;
    bid [] public bids;
    uint myid;
    uint myid_af;

    function register_bidder(string memory add1,uint n) public{
        // create an object to point to bidder structure.
        bidder memory next_bidder = bidder(bidderCount,add1,n);
        //Rgistered bidder is inserted into bidders
        bidders.push(next_bidder);
        // store bidder details in tokendetails mapping.
        //mapping from bidder address to bidder structure
        tokendetails[add1] = bidders[bidderCount];

        bidderCount++;

        }
    function bid_item(uint  itemid,string memory addr,uint tokens) public {
            // Transaction is reverted if the bid tokens less than the total tokens of the bidder

            if(tokendetails[addr].total_tokens <  tokens)
               revert("this traction is reverted");

            bid memory next_bid = bid(itemid,addr,tokens);
            bids.push(next_bid);
            myid = tokendetails[addr].total_tokens;
            // bid tokens must be subtracted from total tokens of the bidder

            tokendetails[addr].total_tokens -= tokens;

            myid_af = tokendetails[addr].total_tokens;
            // bidders is an array of structures.
            // tokendetails[addr].bidderId gives the bidder address
            // bidders[tokendetails[addr].bidderId] points to bidder structure

            bidders[tokendetails[addr].bidderId].total_tokens = tokendetails[addr].total_tokens;






        }


    function getmyid() public view returns(uint ){
        return myid;
    }
    function getmyid_af() public view returns(uint ){
        return myid_af;
    }
    function getbid_details(uint i,uint _itemid) public view returns(uint,string memory){
        if (bids[i].itemid == _itemid)       
        return (bids[i].amount,bids[i].bidder_address);
        else
        return (0,'0x0');

    }
    function bid_length() public view returns(uint){
        return bids.length;
    }
    function winner_address(uint id) public view returns(string memory ){
        return bids[id].bidder_address;
    }


}
